// src/pages/BehavioralQuestionPage.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const BehavioralQuestionPage = () => {
  const [questions, setQuestions] = useState([]);

  useEffect(() => {
    axios.get('/api/behavioral-questions')
      .then(response => setQuestions(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h1 className="text-4xl font-bold mb-4">Behavioral Questions</h1>
      {questions.map(question => (
        <div key={question._id} className="mb-4">
          <h2 className="text-2xl font-bold">{question.title}</h2>
          <p>{question.description}</p>
          <a href={question.link} className="text-blue-500 hover:underline">Practice Questions</a>
        </div>
      ))}
    </div>
  );
};

export default BehavioralQuestionPage;
